import React from 'react';
import {Theme} from "dark-mode-ts";
import darkIcon from './mooon.png';
import lightIcon from '.sun.png'
import "./darkmode.css";

export function DarkMode() {
    return (
        <div className='darkmode' id='switch'>
        <Theme
          darkIcon={darkIcon}
          lightIcon={lightIcon}
          altDark='dark icon'
          altLight="light icon"
          imgWidth='50'
          imgHeight='50'
          myClass="your-class_name"
        />
      </div>
    );
}
